import React from 'react';
import classes from "./chat.module.css";

const  Chat = (props)=>
{
    return(
        <div className={classes.pole}>
            <div className={classes.sms}>
                <div className={classes.iconsUser}>

                </div>
                <div className={classes.poleMessage}>
                    <p>hello world!!!</p>
                </div>
            </div>
        </div>
    );
}
export default Chat;
